{
  "openapi": "3.0.0",
  "info": {
    "version": "2018-08-01",
    "x-release": "v4",
    "title": "AWS RDS Data Service",
    "description": "Amazon RDS provides an HTTP endpoint to run SQL statements on an Amazon Aurora Serverless DB cluster. To run these statements, you work with the Data Service API. For more information about the Data Service API, see Using the Data API for Aurora Serverless in the Amazon Aurora User Guide.  If you have questions or comments related to the Data API, send email to Rds-data-api-feedback@amazon.com.",
